const defaultTheme = createTheme();

export default function Album() {
  return (
    <ThemeProvider theme={defaultTheme}>
      <CssBaseline />
      <div style={{ display: 'flex' }}>
        <SideBar />
        <div style={{ flexGrow: 1 }}>
          <AppBar position="fixed">
            <Toolbar>
              <CameraIcon sx={{ mr: 2 }} />
              <Typography variant="h6" color="inherit" noWrap>
                Album layout
              </Typography>
            </Toolbar>
          </AppBar>
          <main>
            {/* 나머지 컨텐츠 */}
          </main>
          {/* Footer */}
          {/* 푸터 내용 */}
          {/* End footer */}
        </div>
      </div>
    </ThemeProvider>
  );
}
